import React, { useState } from 'react';

function FillAddressComponent() {
	return (
		<div>
			<Card className="text-center  mb-5 " border="dark" bg="transparent">
				<Card.Header className="slogan-1">
					<h4>Edit Address</h4>
				</Card.Header>
				<Card.Text />
			</Card>
		</div>
	);
}

export default FillAddressComponent;
